            alert(err.message);
        }
    }

    public async send() {
        try {
            console.log(this.product);
            await this.dataService.addProduct(this.product);
            alert("product has been added");
            this.router.navigateByUrl("/list");


        }
        catch (err: any) {
            alert(err.message);
        }
    }


}
